import { StyleSheet } from "react-native";
import { Dimensions } from 'react-native';

const windowHeight = Dimensions.get('window').height;

export default StyleSheet.create({
    pag:{
        alignItems: 'center',
        backgroundColor: "white",
        flex: 1
    },
    img:{
        width:400,
        height:150
    },
    cards:{
        borderWidth:1,
        borderColor:'#ccc',
        margin: 5,
        padding: 5,
    },
    title:{
        fontSize: 10
    }
});
